import React, { Component } from "react"

class UserAdmin extends Component{
    
    state={
        user:[]
    }

    componentDidMount(){
        fetch(`http://localhost:4000/adminusers`,{
            method:'GET',
            headers: new Headers({'Content-Type' : 'applications/json','authorization': localStorage.getItem('tok')})
        }
        )
        .then(response => response.json())
        .then(data=>{
            this.setState({
                user:data
            })
        })

        if (localStorage.getItem('tok') !== 'undefined' && 
        localStorage.getItem('tok') && 
        localStorage.getItem('type') == 'admin') {
        this.history.props('/editprofile')
        }
        else {
            this.props.history.push('/')
        }
    }
    
    
    
    render(){
        return(
            <div>
                {this.state.user.map(element=>{
                    return(
                        <h6 key={element.user_id}>{element.user_id}</h6>
                    )
                })}
            </div>
        )
    }
}

export default UserAdmin
